import { BrowserRouter, Switch, Route } from "react-router-dom";
import Home from "./components/pages/Home";

function App() {
  return (
    <>
      <BrowserRouter>
        {/* <Routes> */}
        <Switch>
          <Route exact path="/" component={Home} />
        </Switch>

        {/* </Routes> */}
      </BrowserRouter>
    </>
  );
}

export default App;
